public float coord(int overlap, int maxOverlap) {
  if (coordType == 0) {
    return 1.0f;
  } else if (coordType == 1) {
    return defaultSim.coord(overlap, maxOverlap);
  } else {
    return overlap / ((float)maxOverlap + 1);
  }
}

